import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: ''
  });
  const [error, setError] = useState('');
  const { login } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const from = location.state?.from?.pathname || '/admin';

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');

    // Simple authentication (in real app, this would be API call)
    if (formData.username === 'admin' && formData.password === 'password') {
      login({ username: formData.username, role: 'admin' });
      navigate(from, { replace: true });
    } else {
      setError('Invalid username or password');
    }
  };

  return (
    <div className="container-fluid">
      {/* Hero Section */}
      <section className="coffee-bg text-white section-padding" style={{marginTop: '76px'}}>
        <div className="container">
          <div className="row justify-content-center text-center">
            <div className="col-lg-6">
              <h1 className="display-4 fw-bold mb-4">Admin Login</h1>
              <p className="lead">
                Access the admin panel to manage your coffee shop
              </p>
            </div>
          </div>
        </div>
      </section>

      {/* Login Form */}
      <section className="section-padding">
        <div className="container">
          <div className="row justify-content-center">
            <div className="col-lg-6 col-md-8">
              <div className="card border-0 shadow">
                <div className="card-body p-5">
                  <h3 className="text-coffee mb-4 text-center">Sign In</h3>
                  
                  {error && (
                    <div className="alert alert-danger" role="alert">
                      <i className="fas fa-exclamation-triangle me-2"></i>
                      {error}
                    </div>
                  )}

                  <form onSubmit={handleSubmit}>
                    <div className="mb-4">
                      <label htmlFor="username" className="form-label">Username</label>
                      <input
                        type="text"
                        className="form-control"
                        id="username"
                        name="username"
                        value={formData.username}
                        onChange={handleChange}
                        required
                        placeholder="Enter your username"
                      />
                    </div>

                    <div className="mb-4">
                      <label htmlFor="password" className="form-label">Password</label>
                      <input
                        type="password"
                        className="form-control"
                        id="password"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                        required
                        placeholder="Enter your password"
                      />
                    </div>

                    <div className="d-grid">
                      <button type="submit" className="btn btn-coffee btn-lg">
                        <i className="fas fa-sign-in-alt me-2"></i>
                        Sign In
                      </button>
                    </div>
                  </form>

                  <div className="text-center mt-4">
                    <small className="text-muted">
                      Demo credentials: username: admin, password: password
                    </small>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Login;
